import React from "react";
import { OHLCTooltip, CandlestickChart, XAxis, YAxis, CartesianGrid, Tooltip, Candlestick } from "recharts";
import ohlcChartData from "./OHLCChartWithElderRayIndicatorData.json";

const OHLCChartWithElderRayIndicatorComponent = () => {
  return (
    <CandlestickChart width={500} height={300} data={ohlcChartData}>
      <CartesianGrid />
      <XAxis dataKey="date" />
      <YAxis />
      <Tooltip content={<OHLCTooltip />} />
      <Candlestick />
    </CandlestickChart>
  );
};

export default OHLCChartWithElderRayIndicatorComponent;
